import React from 'react';

export default class Reading extends React.Component  {
    constructor(props) {
      super(props);
      state = {
        admins: [],
      };
    }

    async componentDidMount() {
      let a = await (await fetch('/admin')).json();
      this.setState({
        admins: a,
      });
    }

    render () {
      return (
        <div>
          This is Reading
          {this.admins.map(a, i => {
            <div>{a.username}</div>
          })}
        </div>
      )
    }
  }
